import React from 'react';
import Card from "./card";

class Create_box extends React.Component{
    render() {
        const {items} = this.props;
        const  buildSquareDetails = () => {
            return items.map((item, i) => {
                return (
                    <Card {...item} key = {i}/>
                )
            })
        };

        return(
            <div className={"row"}>
                {buildSquareDetails()}
            </div>
        )

    }

}

export default Create_box;
